import TextField from '@mui/material/TextField';
import { Button, Typography } from '@mui/material';
import TaskIcon from '@mui/icons-material/Task';
import { useNavigate, Link } from 'react-router-dom';
import React, { useState, useEffect } from "react";
import axios from "axios";
import { API_URL } from "../utils";
import { v4 as uuidv4 } from 'uuid';


export const AddUserForm = () => {

  const [newUser, setNewUser] = useState("");
  const [newFirst, setNewFirst] = useState("");
  const [newLast, setNewLast] = useState("");
  const [newEmail, setNewEmail] = useState("");
  const [currentUser, setCurrentUser] = useState({});
  useEffect(() => {
    console.log(currentUser);
  }, [currentUser]);
  
  const AddNewUser = async () => {
    const uuid = uuidv4();
    try {
      const response = await fetch(`${API_URL}/user`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': 'none'
        },
        body: JSON.stringify({
          UserID: uuid,
          OrgID: newUser,
          firstName: newFirst,
          lastName: newLast,
          email: newEmail
        }),
        mode: 'no-cors'
      });
      setCurrentUser({
        UserID: uuid,
        OrgID: newUser,
        firstName: newFirst,
        lastName: newLast,
        email: newEmail
      })
  
      const result = await response.json();
      console.log(result);
      console.log(JSON.stringify(currentUser));
      // Handle the response data here
    } catch (error) {
      console.error(error);
    }
  };

  const navigate = useNavigate();

  useEffect(() => {
    if (currentUser.firstName) {
      console.log(currentUser);
      navigate('/', { state: currentUser });
    }
  }, [currentUser, navigate]);

  return (
    <loginBody>
    <div className='rectangle'>
    <div class="logo-container">
    <img src="thatpivc.png" alt="WebWiz Logo" class="logo"/>
    <span class="logo-text">WEBWIZ</span>
    </div>
      <Typography align="left" variant="h6" paddingTop={2} paddingBottom={2}>
        Create your WebWiz™ account
      </Typography>
      <div className='addUserForm'>
      <TextField fullWidth size='small'
      id="outlined-basic"
      label="First Name"
      name='firstName'
      variant="outlined"
      value={newFirst}
      onChange={(e) => setNewFirst(e.target.value)} />
<TextField fullWidth size='small'
      id="outlined-basic"
      label="Last Name"
      name='lastName'
      variant="outlined"
      value={newLast}
      onChange={(e) => setNewLast(e.target.value)} />
</div>
<div className='addUserForm'>
<TextField fullWidth size='small'
      id="email"
      label="Email"
      variant="outlined"
      value={newEmail}
      onChange={(e) => setNewEmail(e.target.value)}
      name='email'/>
</div>
<div className='addUserForm'>
<TextField fullWidth size='small'
      id="outlined-basic"
      label="Organization ID"
      variant="outlined"
      value={newUser}
      onChange={(e) => setNewUser(e.target.value)}
      name='OrgID'/>
      <Button size='big' disabled={!newUser.length || !newFirst.length || !newLast.length || !newEmail.length}
      variant='outlined' onClick={AddNewUser}paddingTop={2}>
       <TaskIcon/>save
      </Button>
      </div>
      <div className='tinytext'>
      By creating an account, you accept all of the WebWiz terms and conditions
      </div>
      <div className='tinytext'>
      Already have an account? Login <Link to='/create-account'>here!</Link>
      </div>
      
    </div>
    </loginBody>
  )
}
